snippet.description:
FIZEMOS UM AMONG US NA VIDA REAL! É isso mesmo, galera! No vídeo de hoje o Gab, a Cherry, a fun, o Baiano e o Caio jogaram Among US, só que ao vivo! Teve muita discussão, muita desconfiança e muitas tasks nesse desafio surpreendente! Confere aí e diz pra gente se os impostores mandaram bem e se as discussões foram boas!

Nossas redes estão no comentário fixado. Vai lá nos comentários!

